    <div id="viz"></div>
    <script type="text/javascript">

      const width = 400;
      const height = width * 1.25;

      var sampleSVG = d3.select("#viz")
        .append("svg")
        .attr("width", width)
        .attr("height", height);    

      sampleSVG.append("rect")
        .style("stroke", "black")
        .style("fill", "white")
        .style("stroke-width", 3)
        .attr("x", 0)
        .attr("y", 0)
        .attr("width", width)
        .attr("height", height)
        .on("mouseover", function(){d3.select(this).style("fill", "aliceblue");})
        .on("mouseout", function(){d3.select(this).style("fill", "white");});

      const playerRadius = 3;

      sampleSVG.append("circle")
        .attr("id", "P0")
        .style("fill", "none")
        .style("stroke", "blue")
        .attr("r", playerRadius)

      sampleSVG.append("circle")
        .attr("id", "B0")
        .style("fill", "none")
        .style("stroke", "black")
        .attr("r", playerRadius)

      let curFrame = 0;
      let playerLocations = playerDump();
      let ballLocations = ballDump();

      setInterval(function () {
        sampleSVG.select("#P0")
          .attr("cx", trans_x(playerLocations[curFrame][0]))
          .attr("cy", trans_y(playerLocations[curFrame][1]));

        sampleSVG.select("#B0")
          .attr("cx", trans_x(ballLocations[curFrame][0]))
          .attr("cy", trans_y(ballLocations[curFrame][1]));

        curFrame++;
        curFrame %= playerLocations.length;
      }, 50);

      // https://camo.githubusercontent.com/f94e705070da905ab64d5ffef64aecd500457863/68747470733a2f2f696d6775722e636f6d2f6872484b4c6e682e706e67
      function trans_x(x_coord){
        return ((x_coord + 4096) / 8192) * width;
      }

      function trans_y(y_coord){
        return ((y_coord + 5120) / 10240) * height;
      }
